import { CardContent,Card,Box,Typography, Container,Toolbar,AppBar,InputBase } from '@material-ui/core';
import SearchIcon from '@material-ui/icons/Search'
import {makeStyles} from '@material-ui/core/styles'
import Task from './Models/Task'
const useStyles = makeStyles({
    card: {
      minWidth: 275,
      margin:16
    },
    bullet: {
      display: 'inline-block',
      margin: '0 2px',
      transform: 'scale(0.8)',
    },
    title: {
      fontSize: 14,
    },
    pos: {
      marginBottom: 12,
    },
    root:
      {
        display:'flex',
        flexWrap:'wrap',
        flexDirection:'row',
        alignItems:'center',
      }
  });
export default function InternApp(props)
{
    const [state,setState] = useState({});


