    return(
      <Container maxWidth="sm">
      <AppBar>
        <Toolbar>
          <Typography className={classes.title} variant="h6" noWrap>
            Material-UI
          </Typography>
          <div className={classes.search}>
            <div className={classes.searchIcon}>
              <SearchIcon />
            </div>
            <InputBase
              placeholder="Searchâ€¦"
              classes={{
                root: classes.inputRoot,
                input: classes.inputInput,
              }}
              inputProps={{ 'aria-label': 'search' }}
            />
          </div>
        </Toolbar>
      </AppBar>
      <Toolbar></Toolbar>
      <Box className = {classes.root}>
        {
         props.intern.assignments.map(
           assignment=>
           <Task key={assignment.id} title={assignment.task.taskName} description={assignment.task.description} deadline={assignment.task.deadline} />
         )
        }
      </Box>
      </Container>
    )
}
